header.script:
function doSearch() {
    var keyword = $('#keyword').val();
    //var min = $('#min').val().split(',').join('');;
    //var max = $('#max').val().split(',').join('');
    if (keyword == '' || keyword.length < 2 || keyword == 'Nhập từ khóa tìm kiếm') {
        sw_alert('Thông báo !', 'Từ khóa phải nhiều hơn 1 ký tự.');
        return;
    }
    url = 'https://aristino.com/tim-kiem.html?keyword=' + keyword;
    //if (min > 0)
    // url += '&min=' + min;
    //if (max > 0)
    // url += '&max=' + max;
    location.href = url;
}
